import mysql from "mysql2";

//데이터베이스 연결
const pool = mysql.createPool(
    process.env.JAWSDB_URL ?? {
        host: 'localhost',
        user: 'root',
        database: 'database_project',
        password: 'wodyd272895',
        waitForConnections: true,
        connectionLimit: 10,
        queueLimitL: 0
    }
);
// async / await 사용
const promisePool = pool.promise();

// select query
// user테이블을 select
export const selectSql = {
    getuser : async () => {
        const [rows] = await promisePool.query(`select * from user`);
        return rows
    },
//dept_locations 테이블을 select
    getairport : async() => {
        const [rows] = await promisePool.query(`select * from airport`);

        return rows
    },
     getairplane : async() => {
       const [rows] = await promisePool.query(`select * from airplane`);

       return rows
    },
    getflight : async() => {
        const [rows] = await promisePool.query(`select * from flight`);

        return rows
     },
}
